import React from 'react'
import styled, { keyframes } from './styles';

const Help = ({ toggleHelp }) => {
    return (
        <C.HelpContainer onClick={() => toggleHelp()}>
            <C.HelpBox>
                <h1>Help</h1>
            </C.HelpBox>
        </C.HelpContainer>
    )
}

export default Help
